    const {id} = useParams();
    const [record, setRecord] = React.useState({})
    
          useEffect(() => {
            Axios.get(`http://localhost:3001/item/${id}/edit`).then((response) => {
            response.data.map((key, value) => {setRecord(key)});
            })
          }, [])

